import React from 'react';
import './App.css';
import Quiz from '../quiz/Quiz';
import Nav from '../nav/Nav';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import logo from './logo.svg';

const App = () => {
  const navLinks = [
		{
			text: 'Home',
			path: '/',
			icon: 'ion-ios-home'
		},
		{
			text: 'Quiz',
			path: '/quiz',
			icon: 'ion-ios-megaphone'
		}
	]

  return (
    <div className="App">
      <Nav
        navLinks={ navLinks }
        logo={ logo }
        background="#fff"
        hoverBackground="#ddd"
        linkColor="#777"
      />
      <Router>
        <Home />
        <Quiz />
      </Router>
    </div>
  );
}

const Home=()=>(
  <div>
      <h1>Home Page</h1>
  </div>
)

export default App;
